  justify-content: center;
  padding: 15px;
  background-color: #111;
`
const Body = styled.div`
  width: 100%;
  background-color: #414040;
  border-radius: 10px;
  overflow: hidden;
  padding: 77px 55px 33px 55px;
  box-shadow: 0 5px 10px 0px rgba(0, 0, 0, 0.2);
`
